  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Palm Springs and the surrounding cities sit within the massive Coachella Valley Desert of Southern California, surrounded by huge mountains, including San Jacinto Mountain.</p>`,
    hidden_content: null
  }, {
    heading: 'Palm Springs, California',
    anchor: 'palm-springs',
    carousel_id: 'carousel_1',
    body: `<p><strong>Downtown Palm Springs</strong> is a popular tourist destination which features a Hollywood-like Walk of Stars along its sidewalks, as well as many restaurants and unique shops. Nearby is the <strong>Palm Springs Art Museum</strong> displaying European and Native American modern art.</p><h3>Palm Canyon Trail</h3><p>Just south of Palm Springs is a popular hike, the 2 mile (3.2 km) round-trip <strong>Palm Canyon Trail</strong>, which travels through a desert canyon that's filled with palm trees, centered around an oasis-like stream. This trail journeys through one of the Indian Canyons.</p>`,
    hidden_content: null
  }, {
    heading: 'Greater Palm Springs',
    anchor: 'greater-palm-springs',
    carousel_id: null,
    body: `<p>Southeast of Palm Springs in the nearby city of Palm Desert you'll find <strong>The Living Desert Zoo & Gardens</strong>, a popular zoo with large animal enclosures set amongst beautiful desert scenery.</p><p>To the north of Palm Springs in the town of Desert Hot Springs you might visit the <strong>Cabot's Pueblo Museum</strong>, a fascinating Hopi style pueblo house which hosts Native American pottery, art, artifacts, and more within an impressive structure.</p>`,
    hidden_content: null
  }, {
    heading: 'Thousand Palms Oasis',
    anchor: 'thousand-palms-oasis',
    carousel_id: null,
    body: `<p>To the north of Palm Desert is another fantastic palm tree hike set amongst the <strong>Thousand Palms Oasis Preserve</strong>. This 1.7 mile (2.7 km) round-trip hike is the McCallum Trail, which travels alongside an extremely lush natural palm tree garden centered around a river.</p>`,
    hidden_content: null
  }, {
    heading: 'San Jacinto Mountain',
    anchor: 'san-jacinto-mountain',
    carousel_id: 'carousel_2',
    body: `<h3>Palm Springs Aerial Tramway</h3><p>Just west of Palm Springs is the Coachella Valley's top outdoor attraction, the <strong>Palm Springs Aerial Tramway</strong>. This tram takes you up nearly 6,000 feet (1,800 m) above the desert floor to the San Jacinto Mountains, with the top station sitting at an elevation of about 8,500 feet (2,600 m). At the top of the tramway you're rewarded with breathtaking panoramic views high above the city and valley below.</p><h3>Hiking Routes</h3><p>There's also excellent hiking opportunities amongst the stunning lush forests of towering pine trees and rock formations that you can access from the top of the tramway. One of the easiest trails of Mt. San Jacinto is the 2.2 mile (3.5 km) round-trip loop <strong>Desert View Trail</strong>, which offers multiple viewpoints over the Coachella Valley below.</p><p>For a longer hike with outstanding scenery along the way you should walk the <strong>Round Valley Loop Trail</strong>, and add the extra spur trail to the serene <strong>Hidden Lake</strong> and the gorgeous Desert View (a different desert viewpoint). This hiking route has a round-trip distance of about 4.9 miles (7.9 km).</p><p>The most challenging and rewarding hike in these mountains is the 9.6 mile (15.4 km) round-trip trail to <strong>San Jacinto Peak</strong>, which has an elevation gain of nearly 2,600 feet (800 m). This scenic hike through the rocky forests leads to the top of Mt. San Jacinto, from which you can enjoy majestic far-reaching views.</p>`,
    hidden_content: null
  }, {
    heading: 'Salton Sea & Salvation Mountain',
    anchor: 'salton-sea',
    carousel_id: 'carousel_3',
    body: `<h3>Cholla Cactus Gardens</h3><p>Much further southeast into the Coachella Valley is California's largest lake, the Salton Sea. The lake is mostly dead now, however you can explore the ruins of what was once a popular tourist destination along the lake at the <strong>Bombay Beach Ruins</strong>, a very interesting and unique attraction.</p><h3>Salvation Mountain</h3><p>Further southeast is the iconic <strong>Salvation Mountain</strong>, which consists of massive art painted hills and strange art installations, as well as colorful rooms built into the hill. Salvation Mountain is very unique and a great place for photos.</p><h3>East Jesus</h3><p>Nearby Salvation Mountain you can visit the <strong>East Jesus</strong> open-air museum, where junk has been turned into incredible works of eccentric art.</p>`,
    hidden_content: null
  }, {
    heading: 'Painted Canyon Trail',
    anchor: 'painted-canyon-trail',
    carousel_id: null,
    body: `<p>One more attraction to consider around the Coachella Valley is the <strong>Painted Canyon Trail</strong>, which is located just north of the Salton Sea. This 3.8 mile (6.1 km) round-trip trail winds through a scenic and rugged desert slot canyon, with ropes and ladders placed along the trail for excitement. Parts of the canyon are quite colorful with the correct lighting, however most of it is sandstone colored.</p>`,
    hidden_content: null
  }],
