  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The following attractions are listed in order along a recommended route through gorgeous Joshua Tree National Park. This massive desert landscape is full of majestic mountains, mesmerizing giant rocks, and of course the park's signature Joshua trees.</p>`,
    hidden_content: null
  }, {
    heading: 'Short Hiking Trails',
    anchor: 'short-hiking-trails',
    carousel_id: 'carousel_1',
    body: `<p>Begin your scenic drive through Joshua Tree National Park while enjoying the majestic scenery. Along the drive through the park are many scenic pull-offs you should consider stopping at in addition to the listed attractions.</p><h3>Hidden Valley Nature Trail</h3><p>First you'll come across the 1 mile (1.6 km) round-trip <strong>Hidden Valley Nature Trail</strong>, which loops around a stunning area of complex rock formations and Joshua trees.</p><h3>Barker Dam Nature Trail</h3><p>Nearby Hidden Valley is the 1.2 mile (1.9 km) round-trip <strong>Barker Dam Nature Trail</strong>, which ventures along a similar landscape that includes a seasonal lake as well as petroglyphs. These two easy trails are the park's most popular hikes and are highly recommended.</p>`,
    hidden_content: null
  }, {
    heading: 'Keys View & Rocky Areas',
    anchor: 'keys-view-and-rocky-areas',
    carousel_id: null,
    body: `<h3>Cap Rock</h3><p>Continue along the road to the <strong>Cap Rock</strong> area, which consists of several massive rock piles that you can explore and climb on. The very short Cap Rock Nature Trail circles around some of these rocks.</p><h3>Keys View</h3><p>From Cap Rock you can take a detour heading south up to <strong>Keys View</strong>, a breathtaking viewpoint that overlooks Palm Springs and the Coachella Valley from high above. Keys View provides amazing views in the day, and especially at night when the cities of the Coachella Valley brilliantly light up.</p><h3>Hall of Horrors</h3><p>Next you can visit the <strong>Hall of Horrors</strong>, another scenic rocky area that's popular for rock climbing (with and without gear) which you might explore a bit.</p>`,
    hidden_content: null
  }, {
    heading: 'Ryan Mountain Trail',
    anchor: 'ryan-mountain-trail',
    carousel_id: null,
    body: `<p>Nearby the Hall of Horrors is the trailhead for the <strong>Ryan Mountain Trail</strong>, another very popular hike that's about 2.8 mile (4.5 km) round-trip. From the top of Ryan Mountain you can enjoy excellent views over Joshua Tree. This hike is more challenging than the easy flat ones, with a steep elevation gain of nearly 1,100 feet (330 m).</p>`,
    hidden_content: null
  }, {
    heading: 'Major Rock Formations',
    anchor: 'rock-formations',
    carousel_id: 'carousel_2',
    body: `<h3>Skull Rock & Face Rock</h3><p>Continue along to the park's most iconic sight, the striking <strong>Skull Rock</strong>, which is literally shaped like a giant human skull and located just off the road. Just across the street from Skull Rock is the stunning <strong>Face Rock</strong>, which looks like the side profile of a face. This strange rock is a very short walk away from Skull Rock.</p><p>Another interesting rock formation nearby Skull Rock is Split Rock, which you can see via a 1.9 mile (3.1 km) round-trip trail.</p><h3>Arch Rock</h3><p>Next you can see another impressive rock formation via the 0.5 mile (0.8 km) round-trip <strong>Arch Rock Nature Trail</strong>, which offers a short but scenic journey to a natural arch. This trail begins at the end of the road within the White Tank Campground.</p>`,
    hidden_content: null
  }, {
    heading: 'More Attractions',
    anchor: 'more-attractions',
    carousel_id: null,
    body: `<h3>Cholla Cactus Gardens</h3><p>Continue to the <strong>Cholla Cactus Gardens</strong> where you can take a short walk amongst a vast field of strange but beautiful cacti.</p><h3>Lost Palm Oasis Trail</h3><p>If you like you can continue your scenic drive through the more remote eastern section of the park, which hosts more hiking trails, including the popular 7.2 mile (11.6 km) Lost Palms Oasis Trail which journeys through a stunning wild desert landscape. This trailhead is located near the national park's other visitor center, the Cottonwood Visitor Center, which is also near where the park's main road intersects Highway 10.</p><h3>Fortynine Palms Oasis Trail</h3><p>Another short hike you might consider is the 2.8 mile (4.5 km) round-trip <strong>Fortynine Palms Oasis Trail</strong>, which ventures through the dry desert before leading to a surprising small water oasis surrounded by many palm trees. This trail is located north of the park off of Highway 62, near the Oasis Visitor Center in the the town of Twentynine Palms.</p>`,
    hidden_content: null
  }, {
    heading: 'Noah Purifoy Outdoor Desert Art Museum',
    anchor: 'desert-art-museum',
    carousel_id: null,
    body: `<p>Just outside of Joshua Tree National Park is the <strong>Noah Purifoy Outdoor Desert Art Museum</strong>, which contains very eccentric and unique art installations made out of old objects. This open-air museum's exhibits are very impressive and intriguing.</p>`,
    hidden_content: null
  }],
