  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Lake Tahoe is a magnificent alpine lake set amongst the vast forests of the Sierra Nevada Mountains. This massive lake sits along the border of California and Nevada, and the area around the lake offers many different types of activities year-round. In the summer there's great hiking opportunities, as well as beautiful beaches offering swimming and kayaking. In the winter the area offers countless ski resorts to experience.</p>`,
    hidden_content: null
  }, {
    heading: 'South Lake Tahoe',
    anchor: 'south-lake-tahoe',
    carousel_id: 'carousel_1',
    body: `<p>The lake's main city is South Lake Tahoe on the southeastern shore. Here you'll find <strong>The Shops at Heavenly Village</strong>, an outdoor mall which resembles a majestic mountain lodge.</p><h3>Stateline, Nevada</h3><p>Just a couple blocks away within walking distance of Heavenly Village is the Nevada border town of <strong>Stateline</strong>, which hosts four Las Vegas-like mega casinos.</p><h3>Nevada Beach</h3><p>A bit north of Stateline and South Lake Tahoe is <strong>Nevada Beach</strong>, where the pine forest quickly turns into a vibrant sandy beach, from which you can enjoy striking views of the surrounding mountains over the lake.</p>`,
    hidden_content: null
  }, {
    heading: 'Emerald Bay State Park',
    anchor: 'emerald-bay',
    carousel_id: 'carousel_2',
    body: `<p>To the west of South Lake Tahoe is one of the lake's most scenic areas, <strong>Emerald Bay State Park</strong> with its bright blue waters. Here you can take amazing views over the bay as well as of nearby <strong>Eagle Falls</strong> which flows into the lake.</p><p>Nearby Eagle Falls you can hike down to the castle-like <strong>Vikingsholm</strong>, an impressive historic mansion which sits on the lakeshore and offers tours in the warmer seasons. This popular hike to Vikingsholm is about 1.6 miles round-trip. Adjacent to the mansion is a beach and kayak rental from which you can explore Emerald Bay and the nearby Fannette Island.</p><p>Just east of Emerald Bay is another vibrant sandy beach with stunning clear waters, <strong>Baldwin Beach</strong>. To the south of Baldwin Beach you can drive to the beautiful <strong>Glen Alpine Falls</strong>, which is located just off the road.</p>`,
    hidden_content: null
  }, {
    heading: 'Emerald Bay Hikes',
    anchor: 'emerald-bay-hikes',
    carousel_id: null,
    body: `<h3>Eagle Lake & Cascade Falls</h3><p>Nearby Emerald Bay are several hikes through the serene rocky forest, including the 1.8 mile (2.9 km) round-trip trail up to picturesque <strong>Eagle Lake</strong>, which is surrounded by mountains. Close-by is the 1.4 mile (2.3 km) round-trip trail to the lovely <strong>Cascade Falls</strong>, which also hosts views over Cascade Lake below. The Cascade Falls Trail begins from the Bayview Trailhead.</p><h3>Maggies Peak & Granite Lake</h3><p>From the same Bayview Trailhead is a more challenging and rewarding hike to consider, the Granite Lake Trail. This hike passes the serene Granite Lake before reaching the top of <strong>Maggies Peak South</strong>, from which you can enjoy incredible views over Emerald Bay and part of Lake Tahoe. This trail has about 1,750 feet (540 m) of elevation gain and a round-trip distance of 3.8 miles (6.1 km).</p>`,
    hidden_content: null
  }, {
    heading: 'Crystal Bay',
    anchor: 'crystal-bay',
    carousel_id: 'carousel_3',
    body: `<h3>Sand Harbor</h3><p>On the northeastern side of Lake Tahoe is perhaps the lake's most gorgeous beach, <strong>Sand Harbor</strong>. This beach's waters are vivid shades of bright green and blue, with bold rounded rocks sticking out of the water, all surrounded by incredible scenery. Sand Harbor sits at the eastern edge of Lake Tahoe's Crystal Bay.</p><h3>Bonsai Rock</h3><p>Nearby Sand Harbor is the picturesque <strong>Bonsai Rock</strong>, an iconic rock just off the coast which has a small bonasi-like tree atop it. You can pull off the highway and take a very short hike down to the water to admire this amazing natural feature.</p><h3>Thunderbird Lodge</h3><p>Just south of the Bonsai Tree is the <strong>Thunderbird Lodge Preservation</strong>, a lovely historic cabin-like mansion located which hosts a scenic lakeside garden and excellent lake views. You can make reservations if you'd like to tour this historic structure.</p><h3>Stateline Fire Lookout</h3><p>At the center of the northern side of Lake Tahoe is one of the lake's greatest lookout points, the <strong>Historic Stateline Fire Lookout</strong> (also known as Crystal Bay Scenic Overlook), which offers gorgeous views overlooking the lake and Crystal Bay from high above. You can reach this viewpoint via a 1.5 mile (2.4 km) round-trip trail starting from the bottom of Lookout Road.</p>`,
    hidden_content: null
  }, {
    heading: 'Tahoe City, California',
    anchor: 'tahoe-city',
    carousel_id: null,
    body: `<p>Along the central western side of the lake south of Tahoe City is <strong>Eagle Rock</strong>, which provides breathtaking views over Lake Tahoe from a very different vantage point than those previously mentioned. You can reach the top of Eagle Rock with an easy 0.7 mile (1.1 km) round-trip hike.</p>`,
    hidden_content: null
  }],
