  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The stretch of road along the Pacific Coast Highway (Highway 1) of Central California is considered to be one of the most scenic driving routes in the world. The following attractions are listed in order along a recommended route down the coast beginning near Big Sur and ending in Santa Barbara or Los Angeles.</p>`,
    hidden_content: null
  }, {
    heading: 'Garrapata State Park',
    anchor: 'garrapata-state-park',
    carousel_id: 'carousel_1',
    body: `<p>Start your day by heading south along the coast from Carmel-By-The-Sea, passing the Point Lobos State Natural Reserve if you have already visited it.</p><p>Just south of Point Lobos you might take a scenic walk along the <strong>Soberanes Point Trails</strong>, which follow along a rugged rocky part of the coastline. A bit further south you might like to stop at <strong>Garrapata State Beach</strong> and take a quick walk down to the beach to admire the incredible seaside scenery. Either of these places are great for watching the sunset over the Pacific Ocean.</p><p>Garrapata State Park is located just south of the city of Carmel-By-The-Sea, which hosts many more attractions including the serene Point Lobos State Natural Reserve.</p>`,
    hidden_content: null
  }, {
    heading: 'Big Sur, California',
    anchor: 'big-sur',
    carousel_id: null,
    body: `<h3>Scenic Bridges</h3><p>Continue south to the striking <strong>Rocky Creek Bridge</strong>, which you can pull-off the highway to admire. Just south of this bridge you can stop at the Castle Rock Viewpoint, which overlooks the iconic <strong>Bixby Creek Bridge</strong> set amongst the coastal cliffs.</p><h3>Pfeiffer Beach</h3><p>Next you might take a small detour to <strong>Pfeiffer Beach</strong>, which features an incredible sea arch that can be viewed with a quick 0.5 mile (0.8 km) round-trip walk from the parking area.</p><h3>McWay Falls</h3><p>The next attraction is one of the Central California Coast's most iconic sights, the gorgeous <strong>McWay Falls</strong>, which flows off of a cliff into the ocean, set within a stunning small cove. You can park along the highway and take a very short walk to see this picturesque waterfall.</p><h3>Scenic Viewpoints</h3><p>Apart from the random scenic pull-offs you'll encounter as you continue down the highway, the major coastal viewpoints you should definitely stop at along the way include the <strong>Big Creek Cove Vista Point</strong> and <strong>Jade Cove</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Hearst Castle',
    anchor: 'hearst-castle',
    carousel_id: 'carousel_2',
    body: `<p>Continue south to <strong>Ragged Point</strong>, a popular stop along the highway which hosts excellent coastal views from atop the cliffs.</p><p>Afterwards you might like to visit the famous <strong>Hearst Castle</strong> in San Simeon. This palatial 20th century mansion is known for its many elaborate lavish themed rooms, as well as its grand Romanesque-style <strong>Neptune Pool</strong>.</p><p>Be aware that tours of the Hearst Castle are very expensive, and each tour only shows a portion of the estate. Additionally, visiting the castle can be very time consuming if tours are not pre-booked, so if you plan to explore this castle you'll need plenty of time.</p>`,
    hidden_content: null
  }, {
    heading: 'Morro Bay, California',
    anchor: 'morro-bay',
    carousel_id: null,
    body: `<p>Next you can stop in the coastal town of Morro Bay to see the massive <strong>Morro Rock</strong>, which sits on the end of a peninsula at the entrance to Morro Bay, towering over 580 feet (175 m) above the coast.</p>`,
    hidden_content: null
  }, {
    heading: 'San Luis Obispo, California',
    anchor: 'san-luis-obispo',
    carousel_id: null,
    body: `<p>If you haven't eaten yet you might stop next at <strong>the Madonna Inn</strong>, a very strange and intricately decorated hotel and restaurant which is incredibly popular for its incredible eccentric design. This restaurant is located just off the highway in San Luis Obispo.</p><p>Downtown San Luis Obispo features some great restaurants, art galleries, and shopping, as well as a thriving nightlife scene.</p>`,
    hidden_content: null
  }, {
    heading: 'Solvang, California',
    anchor: 'solvang',
    carousel_id: null,
    body: `<p>Consider taking a detour to visit the lovely Danish town of <strong>Solvang</strong>, which is well known for its traditional Danish style half-timbered houses and windmills. This town was originally settled by Danish pioneers in the 19th century and still retains some Danish culture, especially with its cuisine.</p><h3>Santa Barbara, California</h3><p>Further south of San Luis Obispo and Solvang is the popular coastal city of Santa Barbara. This city hosts an old Spanish mission from the 1820s, the Mission Santa Barbara, as well as the El Presidio de Santa Barbara State Historic Park, which was built in the 1780s ando hosts a museum. Downtown Santa Barbara is centered around State Street, a great place to eat or enjoy the nightlife. There's also lots of great camping sites around Santa Barbara.</p>`,
    hidden_content: null
  }],
