  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The following attractions are listed in order along a recommended route up part of California's scenic northern coast along Highway 1. This route begins north of San Francisco near Point Reyes and concludes at the point where the highway turns inland, just before it passes through the grand Redwood Forests.</p>`,
    hidden_content: null
  }, {
    heading: 'Bodega Bay, California',
    anchor: 'bodega-bay',
    carousel_id: 'carousel_1',
    body: `<p>Begin your day by visiting the majestic <strong>Bodega Bay</strong>, your first scenic viewpoint along the Northern California coast north of Point Reyes. The views from near the parking area are beautiful, however you also have the option of walking along the 1.7 mile (2.7 km) round-trip loop of the Bodega Head Trail, which follows around the picturesque cliffs of Bodega Bay.</p>`,
    hidden_content: null
  }, {
    heading: 'Fort Ross State Historic Park',
    anchor: 'fort-ross',
    carousel_id: null,
    body: `<p>Continue up the coast to the lovely <strong>Fort Ross Windmill</strong> and the fascinating <strong>Fort Ross State Historic Park</strong>, where you can explore a giant reconstructed wooden fortress, originally built by the Russians.</p><p>This impressive fortress was built in the 19th century when Russia owned Alaska and much of the Pacific Northwest, as Russia tried to extend their land claims further south, before eventually selling the land to the United States. Just be aware that Fort Ross closes quite early in the day.</p>`,
    hidden_content: null
  }, {
    heading: 'Point Arena Lighthouse',
    anchor: 'point-arena',
    carousel_id: null,
    body: `<p>Next you can visit the small but stunning <strong>Sea Ranch Chapel</strong>, a highly intricate and elegant structure.</p><p>Further north is the charming <strong>Point Arena Lighthouse</strong>. This lighthouse sits on a small peninsula that offers striking panoramic over the rugged coast. Before reaching the lighthouse, be sure to stop along the various viewpoints along the rugged coastal cliffs, especially the viewpoint overlooking the <strong>Sea Lion Rocks</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Little River Blowhole',
    anchor: 'little-river-blowhole',
    carousel_id: 'carousel_2',
    body: `<p>Continue towards Mendocino, stopping in the town of Little River to see a mostly unknown sight, the beautiful <strong>Little River Blowhole</strong>. The blowhole itself is actually huge and quite mesmerizing, hidden within a small forest.</p><p>To reach the blowhole you'll need to park along the western side of Highway 1 next to the entrance of the large graveyard, just south of Little River. Simply walk straight through the graveyard gate and straight back into the forest, where you'll very quickly reach this striking natural feature.</p>`,
    hidden_content: null
  }, {
    heading: 'Mendocino, California',
    anchor: 'mendocino',
    carousel_id: null,
    body: `<p>Just north of Little River is the lovely town of Mendocino, where you can explore the absolutely gorgeous Mendocino Headlands State Park. You can park at the end of the city's Main Street and take a short walk over to the picturesque <strong>Portuguese Beach</strong>. Continue walking to the nearby <strong>Point Mendocino Blowhole</strong>, which offers amazing views over the vibrant light blue waters of Mendocino Bay.</p><p>From the Point Mendocino Blowhole you can either walk along the headland trails (about 3.1 miles/5 km round-trip), or drive and park at the various points of interest along the headlands, such as the <strong>Mendocino Headlands Sea Arch</strong>.</p><h3>Russian Gulch Bridge</h3><p>Just north of Mendocino is the stunning <strong>Russian Gulch Bridge</strong>. The best viewpoint overlooking this bridge is from the nearby Russian Gulch Bridge Viewpoint, located just west of the bridge.</p><h3>Point Cabrillo Lighthouse</h3><p>Further north of Mendocino you might like to stop at the <strong>Point Cabrillo Light Station</strong>, a quaint old lighthouse. From the parking area, it's a scenic 1.4 mile (2.3 km) round-trip walk to reach the lighthouse, with the possibility of further exploring along the cliffs.</p>`,
    hidden_content: null
  }, {
    heading: 'Fort Bragg, California',
    anchor: 'fort-bragg',
    carousel_id: 'carousel_3',
    body: `<h3>Mendocino Coast Botanical Gardens</h3><p>Just south of Fort Bragg is the popular <strong>Mendocino Coast Botanical Gardens</strong>, which hosts miles of trails to explore amongst a vast seaside garden atop the cliffs.</p><h3>Glass Beach</h3><p>Continue up to the beautiful <strong>Glass Beach</strong> of Fort Bragg, which consists of countless tiny dull pieces of multi-colored glass which is completely safe to walk on. The pebble-like glass is so tiny that you may need to look very close to see that the beach is not made of simple pebbles or rocks.</p><p>You can walk or drive up just north of the Glass Beach to view the impressive wooden <strong>Pudding Creek Trestle Bridge</strong> if you like, which is quite photogenic.</p><h3>MacKerricher Beach Dune World</h3><p>Afterwards stop along at the MacKerricher Beach Dune World trailhead to enjoy incredible views over the <strong>Ten Mile River Bridge</strong>, which spans this scenic river just before it reaches the ocean. If you'd like you might explore the dunes and the beach, you might consdier hiking the 4.6 miles (7.4 km) round-trip trail amongst the dunes.</p>`,
    hidden_content: null
  }],
