    meta_keywords: 'lower northern california coast southbound attractions guide, lower northern california coast southbound top attractions, lower northern california coast southbound destination guide, lower northern california coast southbound google maps list, lower northern california coast southbound california attractions',
    social_media_title: 'Lower Northern California Coast, California (Soutbound) Attractions Guide',
