  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Orange County is located along the Southern California coast between Los Angeles and San Diego, and is best known for its beautiful sandy beaches, giant high-end shopping malls, and the original Disneyland theme park.</p>`,
    hidden_content: null
  }, {
    heading: 'Huntington Beach, California',
    anchor: 'huntington-beach',
    carousel_id: 'carousel_1',
    body: `<p>Among the most popular beaches in Orange County is the vast sandy beach of Huntington Beach, which holds the official title of Surf City, USA. Around the city's iconic <strong>Huntington Beach Pier</strong> you'll find many great shops, restaurants, bars, and nightlife.</p>`,
    hidden_content: null
  }, {
    heading: 'Newport Beach, California',
    anchor: 'newport-beach',
    carousel_id: null,
    body: `<p>South of Huntington Beach within the city of Newport Beach you'll find the popular <strong>Corona Del Mar Beach</strong>. On the western side of the beach is a striking rocky moonlike landscape that you can explore, which leads to a tiny cove known as Hidden Beach. Be sure to take in views from Inspiration Point above the southern side of Corona Del Mar Beach as well, which overlooks the coastline.</p><p>In Southern Newport Beach you can visit Crystal Cove State Park, a long undeveloped part of the coastline. Crystal Cove hosts stunning cliffs and tidal pools, the best of which are located on the western end of the park at <strong>Pelican Point</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Laguna Beach, California',
    anchor: 'laguna-beach',
    carousel_id: 'carousel_2',
    body: `<p>Among the most scenic places in Orange County is the city of Laguna Beach, which is located south of Newport Beach. The <strong>Downtown Laguna Beach</strong> area hosts many art galleries and restaurants, which stretch down the coast along Pacific Highway. The city also hosts countless picturesque cliffside beaches and coves.</p><p>Among the best places to walk along the coastal cliffs in Laguna Beach are the stunning landscaped gardens of <strong>Heisler Park</strong>, which also features tide pools below them. Just north of Heisler Park you can enjoy amazing coastal views from <strong>Crescent Bay Point Park</strong> and the neighboring <strong>Shaws Cove</strong>.</p><p>Up in the mountains above Laguna Beach is the <strong>Top of the World</strong> viewpoint, which offers breathtaking panoramic views overlooking the city and the hilly coastline, with gorgeous views during the day, night, and sunset.</p><p>Other noteworthy coastal sights in Laguna Beach include the fairytale-like <strong>Pirate Tower</strong>, which is built just above the ocean at Victoria Beach, south of Downtown. Just south of Victoria Beach is the <strong>Treasure Island Beach & Park</strong>, which features another lovely scenic walk along the coast. Halfway through this coastal walk you can take the path down to the beach to walk under a sea arch, or just to enjoy the sand and the waves.</p>`,
    hidden_content: null
  }, {
    heading: 'Dana Point, California',
    anchor: 'dana-point',
    carousel_id: null,
    body: `<p>Further south of Laguna Beach is the majestic <strong>Dana Strands Beach</strong>, which sits below massive sheer cliffs. What sets this beach apart from all of the rest is that if offers convenient free parking. You can walk past the sand on the southern end of this beach to explore tidal pools and caves below the Dana Point Headland.</p>`,
    hidden_content: null
  }, {
    heading: 'Theme Parks',
    anchor: 'theme-parks',
    carousel_id: null,
    body: `<h3>Disneyland</h3><p>If you're visiting Orange County, you're likely also visiting Disneyland, the original Disney park. Across from Disneyland is a second theme park, Disney California Adventure, which features many more rides and attractions. You'll definitely need more than one day if you wish to fully experience all that both of these parks have to offer.</p><h3>Knott's Berry Farm</h3><p>A popular and less expensive alternative to Disneyland is the nearby Knott's Berry Farm theme park, which is also extremely popular and hosts world-class rides set within fun themed areas.</p>`,
    hidden_content: null
  }, {
    heading: 'Shopping Malls',
    anchor: 'shopping-malls',
    carousel_id: null,
    body: `<p>If you're looking to shop in Orange County, you should consider visiting Costa Mesa's South Coast Plaza, the third largest shopping mall in the United States. Another extremely popular mall is the Irvine Spectrum Center, a massive outdoor mall with many upscale stores and restaurants.</p><p>Near Corona Del Mar in Newport Beach is the ultra-lavish outdoor Fashion Island Mall, which hosts many high-end shops and restaurants. Adjacent to the mall's Macy's Department Store you can enjoy fantastic views overlooking the coast and the Pacific Ocean from high above, with views stretching to the far away Catalina Island on a clear day.</p>`,
    hidden_content: null
  }],
