  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Just north of San Francisco across the Golden Gate Bridge is the wooded mountainous landscape of Mount Tamalpais State Park, which towers above the coast.</p><p>A bit further north of San Francisco and northwest of Mount Tamalpais is the Point Reyes National Seashore, a massive peninsula with many excellent hiking opportunities and stunning scenery. It's highly recommended to visit the Point Reyes area in the Spring when the entire peninsula is green and in bloom. </p>`,
    hidden_content: null
  }, {
    heading: 'Mount Tamalpais',
    anchor: 'mount-tamalpais',
    carousel_id: 'carousel_1',
    body: `<p>The best views this park has to offer are from <strong>Mount Tamalpais East Peak</strong>, which can be reached via a short 0.8 mile (1.3 km) round-trip hike from the nearby parking lot.</p><p>From atop Mount Tamalpais East Peak you can enjoy gorgeous panoramic views over the San Francisco Bay, the city of San Francisco, the Pacific coast, and the surrounding mountains. These views can be enjoyed from the East Peak Summit Fire Lookout atop the East Peak on a very clear day.</p><h3>Cataract Falls</h3><p>Another popular hike in this area is the 2.7 mile (4.3 km) round-trip Cataract Falls Trail, which travels through a lush rocky forest alongside Cataract Creek and the beautiful <strong>Cataract Falls</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Alamere Falls',
    anchor: 'alamere-falls',
    carousel_id: null,
    body: `<p>The most popular longer trail on the Point Reyes Peninsula is the 7.9 mile (12.7 km) round-trip Coast Trail, which leads to <strong>Alamere Falls</strong>. This stunning waterfall drops onto the beach and flows into the ocean.`,
    hidden_content: `<p>Just behind the giant beach waterfall are several smaller waterfalls, which lead to the main falls. The trail to reach Alamere Falls winds up coastal cliffs before passing through the forest with multiple small lakes along the way, until concluding at the falls and the beach.</p>`
  }, {
    heading: 'Tomales Point',
    anchor: 'tomales-point',
    carousel_id: null,
    body: `<p>The rest of Point Reyes' attractions can be accessed much further north up the peninsula, past the town of Point Reyes Station.</p><p>If you head to the very northern tip of the Point Reyes Peninsula you can hike the gorgeous 9.4 mile (15.1 km) round-trip <strong>Tomales Point Trail</strong>, which travels along the incredibly scenic cliffs and coastline of Tomales Point. This trail offers a very high likelihood of encountering wildlife like deer and elk set amongst the ocean cliffs.</p>`,
    hidden_content: null
  }, {
    heading: 'Point Reyes Peninsula',
    anchor: 'point-reyes-peninsula',
    carousel_id: 'carousel_2',
    body: `<h3>Cypress Tree Tunnel</h3><p>One of the most iconic attractions on this peninsula is the <strong>Cypress Tree Tunnel</strong>, a picturesque tree-lined road which looks like a long dark tunnel, created by the trees' branches.</p><h3>Drake's Beach & Chimney Rock Trail</h3><p>Near the western edge of the peninsula are several more beautiful sights and shorter hikes. First you'll come across <strong>Drake's Beach</strong>, which sits below strikingly beautiful cliffs. Next you might like to stop at the <strong>Elephant Seal Overlook</strong>, which looks outs over a very long section of the coastal cliffs above Drake's Beach.</p><p>From the Elephant Seal Overlook you might like to walk along the 1.9 mile (3.1 km) round-trip <strong>Chimney Rock Trail</strong>, which travels along another scenic end of the peninsula.</p><h3>Point Reyes Lighthouse</h3><p>One of the most stunning sights along the giant peninsula is the lovely <strong>Point Reyes Lighthouse</strong>, a very picturesque structure that sits above the cliffs, reached by a rather steep 1.3 mile (2.1 km) round-trip hike. From the same parking lot as the lighthouse, be sure to take in views from the <strong>South Beach Overlook</strong>.</p>`,
    hidden_content: null
  }],
