  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>San Diego is a magnificent seaside city with many different neighborhoods and attractions, located just above the Mexican border. Because of its location, San Diego hosts excellent Mexican and Tex-Mex cuisine. The city is known for its many stunning beaches, the densely clustered skyscrapers of Downtown San Diego, and the famous San Diego Zoo.</p>`,
    hidden_content: null
  }, {
    heading: 'San Diego Zoo & Safari Park',
    anchor: 'san-diego-zoo-and-safari-park',
    carousel_id: 'carousel_1',
    body: `<p>There are two branches of the <strong>San Diego Zoo</strong>, including the smaller original zoo within Balboa Park near Downtown San Diego, and the <strong>San Diego Zoo Safari Park</strong> in the suburb of Escondido, which hosts massive naturalistic animal exhibits among an expansive property.</p>`,
    hidden_content: null
  }, {
    heading: 'Balboa Park',
    anchor: 'balboa-park',
    carousel_id: null,
    body: `<p><strong>Balboa Park</strong> is located in the hills just above Downtown San Diego and hosts countless museums, beautiful gardens, and impressive Spanish colonial-style buildings such as the <strong>San Diego Museum of Man</strong>. The park also hosts elegant gardens and pools, such as at the Alcazar Garden and Botanical Building.</p><p>From Balboa Park you can also take the Skyfari Aerial Tram over the San Diego Zoo, giving you an amazing perspective over the animal exhibits.</p>`,
    hidden_content: null
  }, {
    heading: 'Downtown San Diego',
    anchor: 'downtown',
    carousel_id: 'carousel_2',
    body: `<h3>Gaslamp Quarter</h3><p>In Downtown San Diego be sure to walk along the historic <strong>Gaslamp Quarter</strong>, where you'll find many great restaurants, bars, and clubs. The Gaslamp District hosts an excellent nightlife scene.</p><h3>USS Midway & Seaport Village</h3><p>Downtown you'll also find the popular Seaport Village hosting great tourist shops and restaurants along the scenic marina. Nearby Seaport Village is the <strong>USS Midway Museum</strong>, a gigantic 1940s US aircraft carrier hosting many exhibits and aircraft. Nearby the aircraft carrier is the Unconditional Surrender Statue, a monumental statue of iconic scene where the Navy veteran who has just returned home from WWII kissing a woman dressed in white.</p><h3>Old Town Historic Park</h3><p>Be sure to also visit the <strong>Old Town San Diego State Historic Park</strong>, which features many well-preserved 1800s Mexican adobe structures that you can explore, set amongst the historic city center near Downtown and the airport.</p>`,
    hidden_content: null
  }, {
    heading: 'Coronado Island',
    anchor: 'coronado-island',
    carousel_id: null,
    body: `<p>From Downtown you can cross the remarkable Coronado Bridge to Coronado Island, which is best known for the iconic and grandiose beachfront <strong>Hotel del Coronado</strong>.</p><p>On the northern side of Coronado Island is <strong>Centennial Park</strong>, which provides incredible views of Downtown San Diego from across the bay. These views are amazing in the daytime as well as at night when the city lights up.</p>`,
    hidden_content: null
  }, {
    heading: 'Point Loma',
    anchor: 'point-loma',
    carousel_id: 'carousel_3',
    body: `<h3>Cabrillo National Monument</h3><p>To the west of Downtown San Diego is the rugged Point Loma peninsula, at the end of which you'll find the <strong>Cabrillo National Monument</strong>. From the monument's Visitor Center and the <strong>Old Point Loma Lighthouse</strong> you can enjoy breathtaking hilltop views overlooking the San Diego Bay. This historic lighthouse is also quite charming and contains a small museum.</p><p>The national monument also contains several old military batteries that you can explore, as well as the Point Loma Tide Pools, and even a secret sea cave located to the north of the tide pools. The sea cave is located along Cabrillo Road just before reaching the water treatment plant.</p><h3>Sunset Cliffs</h3><p>Along the coast of Point Loma just north of Cabrillo National Monument is the incredibly beautiful <strong>Sunset Cliffs Natural Park</strong>, which features stunning complex cliffs along a scenic part of the coastline. You can walk around and explore these cliffs near the parking lot, or walk the 1.9 miles (3.1 km) of trail to see the entirety of the Sunset Cliffs.</p>`,
    hidden_content: null
  }, {
    heading: 'Pacific Beach & Mission Beach',
    anchor: 'pacific-beach',
    carousel_id: null,
    body: `<h3>Belmont Park</h3><p>To the north of Point Loma is the popular Belmont Park, which hosts carnival games, rides, and a rollercoaster, located on the beachfront boardwalk of Mission Beach.</p><h3>Pacific Beach</h3><p>Further up the coast is the <strong>Pacific Beach</strong> neighborhood where you'll find many great restaurants, bars, and stores centered around Garnet Avenue and the Pacific Beach Pier. Pacific Beach also hosts a great nightlife scene.</p>`,
    hidden_content: null
  }, {
    heading: 'La Jolla',
    anchor: 'la-jolla',
    carousel_id: 'carousel_4',
    body: `<p>North of Pacific Beach in the La Jolla neighborhood is a must-see attraction, <strong>La Jolla Cove</strong>. This gorgeous beach features bright blue waters and is surrounded by a scenic rocky coastline.</p><p>The La Jolla Cove is best known for its large population of seals and sea lions, which inhabit the rocks and cliffs around the cove year-round. You can walk along the rocks along the coast and get quite close to these animals, observing them in their natural habitat.</p><p>Nearby La Jolla Cove you can also walk along the La Jolla Tide Pools, which host many forms of sea life. A bit further north is a much larger beach with stunning ocean views, the <strong>La Jolla Shores Park</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Torrey Pines State Reserve',
    anchor: 'torrey-pines',
    carousel_id: null,
    body: `<p>Just north of San Diego is the <strong>Torrey Pines State Reserve</strong>, which is centered around a complex network of coastal cliffs and features excellent hiking opportunities.</p><h3>Hiking Routes</h3>`,
    hidden_content: `<p>The optimal hiking route the reserve has to offer is the Torrey Pines Beach Trail Loop, which ventures below the cliffs along the beach, before venturing back up through small canyons between these striking cliffs. The round-trip length of this trail is about 2.3 miles (3.7 km) starting from the South Beach Lot.</p><p>There's also the option of adding on small scenic loop trails along the way, such as the 0.5 mile (0.8 km) Parry Grove Trail loop and the 0.6 mile (1 km) Guy Fleming Trail loop.</p><p>The most highly recommended add-ons to your hiking route are Yucca Point, Razor Point, Red Butte, and the West Overlook, which will in total add about 1.5 miles (2.4 km) to your hike, for a round-trip hike of about 3.8 miles (6.8 km). Combining all of these listed trails together will give you a round-trip hiking length of about 5 miles (8 km).</p>`
  }, {
    heading: 'Carlsbad, California',
    anchor: 'carlsbad',
    carousel_id: null,
    body: `<p>Another extremely popular attraction to consider near San Diego is the Legoland California theme park in Carlsbad, which also hosts a water park. Carlsbad is also known for its long, beautiful sandy beach, as well as vast The Flower Fields, which bloom seasonally and display a striking array of vibrant colors. Carlsbad is located about 35 miles (56 km) north of Downtown San Diego.</p>`,
    hidden_content: null
  }],
