    carousel_id: null,
    body: `<p>San Francisco is a gorgeous highly-urbanized city located at the tip of a hilly peninsula at the entrance to the vast San Francisco Bay. The city features many iconic sights and important museums, and is one of the United States' few cities that has a great public transportation network (but also terrible car parking).</p>`,
