  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Although these national parks are immensely beautiful, you can quite easily see the main attractions that both parks have to offer within the span of one day. The sights are listed in order along a recommended route through the parks, starting in Kings Canyon.</p>`,
    hidden_content: null
  }, {
    heading: 'Kings Canyon National Park',
    anchor: null,
    carousel_id: 'carousel_1',
    body: `<p>Start your day with a scenic drive through Kings Canyon to the beautiful <strong>Roaring River Falls</strong>, which can be seen with a short walk from the road.</p><p>After enjoying the canyon you can head back out towards the second largest tree in the world, the <strong>General Grant Tree</strong>. You can see this tree via a 0.5 mile (0.8 km) walk through the forest, near Grant Grove Village.</p>`,
    hidden_content: null
  }, {
    heading: 'Sequoia National Park',
    anchor: null,
    carousel_id: null,
    body: `<p>Continue on to Sequoia National Park, where you'll find the largest tree in the world, the <strong>General Sherman Tree</strong>. Adjacent to the tree is the highly recommended <strong>Congress Trail</strong>, which ventures alongside the towering Sequoia trees. This trail is approximately 3 mile (4.8 km) round-trip.</p><p>To the south of the General Sherman tree is one of the national park's most popular attractions, <strong>Moro Rock</strong>, which offers astoundingly gorgeous views over Sequoia National Park. The extremely short trail up to the top of the rock is steep but very rewarding.</p><p>Nearby Moro Rock you'll find the Tunnel Log, a fallen Sequoia tree which you can drive under. Also in this area is the beautiful <strong>Crescent Meadow</strong>, a vast meadow surrounded by tall trees.</p><p>If you still have plenty of time left you might consider heading back up near the Lodgepole Visitor Center, where you'll find the Tokopah Valley Trail. This 3.7 mile (6 km) round-trip trail lead ventures alongside a river within a rocky canyon, before concluding at the stunning <strong>Tokopah Falls</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Mount Whitney',
    anchor: null,
    carousel_id: null,
    body: `<p>Sequoia National Park is also home to the tallest mountain in the contiguous United States, Mt. Whitney. Climbing the mountain however is extremely long and challenging with a round-trip trail length of about 22 miles (35 km). In order to hike up the mountain you'll need to obtain a permit months or years in advance, as this trail is extremely popular.</p>`,
    hidden_content: null
  }],
