  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The Tuolumne Meadows district of Yosemite National Park is a majestic valley full of lush meadows and lakes, which sits at an average elevation of about 8,600 feet (2,625 m), surrounded by many mountain peaks and interesting geological features.</p>`,
    hidden_content: null
  }, {
    heading: 'Tigoa Pass & Tenaya Lake',
    anchor: 'tioga-pass',
    carousel_id: 'carousel_1',
    body: `<p>The Tioga Pass Road through the Tuolumne Meadows district is extremely scenic and connects California's central valley with the desert basin, concluding at Mono Lake. The Tioga Pass features many fantastic pull-offs to view the stunning meadows and the abundance of wildlife that inhabits this part of the park.</p><p>One of the major points along the road is <strong>Olmsted Point</strong>, which overlooks the peaks of Yosemite Valley from behind, including partial views of Half Dome. Just after this viewpoint is the serene <strong>Tenaya Lake</strong>, which is surrounded by forests and rocky mountain slopes.</p>`,
    hidden_content: null
  }, {
    heading: 'Short Hiking Trails',
    anchor: 'short-hiking-trails',
    carousel_id: null,
    body: `<h3>Soda Springs Trail</h3><p>One of the easiest trails to explore along the meadows is the 1.6 mile (2.6 km) round-trip walk to the stone-built Parsons Memorial Lodge and the carbonated <strong>Soda Springs</strong>. This hike follows along part of the Sierra High Route Trail, beginning from the Tuolumne Visitor Center.</p><h3>Lembert Dome Trail</h3><p>A slightly longer trail nearby the Visitor Center is the <strong>Lembert Dome Trail</strong>, which leads to the top of a massive rock dome, from which you can enjoy sweeping views over the Tuolumne Meadows. This trail is approximately 2.5 mile (4 km) round-trip.</p>`,
    hidden_content: null
  }, {
    heading: 'Elizabeth Lake',
    anchor: 'elizabeth-lake',
    carousel_id: 'carousel_2',
    body: `<p>If you'd like to explore even deeper into the meadows you should walk the stunning <strong>Elizabeth Lake Trail</strong>, which ventures further into the wilderness. Along this 5 miles (8 km) round-trip trail you'll have a great chance of encountering wildlife.</p>`,
    hidden_content: null
  }, {
    heading: 'Cathedral Lakes',
    anchor: 'cathedral-lakes',
    carousel_id: null,
    body: `<p>Another popular longer hike near the Visitor Center is the 8.6 mile (13.8 km) round-trip Cathedral Lakes Trail, which journeys through tranquil meadows and forests, passing by the serene <strong>Lower and Upper Cathedral Lakes</strong>.</p>`,
    hidden_content: null
  }, {
    heading: 'Mount Dana',
    anchor: 'mount-dana',
    carousel_id: null,
    body: `<p>Near the very end of the Tioga Pass just before the road descends down into the desert is the trailhead for <strong>Mount Dana</strong>, a challenging trail medium distance trail. The trail to the summit of Mount Dana has about 3,100 feet (950 m) of elevation gain and a round-trip hiking distance of about 4.8 miles (7.7 km).</p><p>The Mount Dana Summit Trail travels high up into the alpine zone and offers gorgeous panoramic views from the top, overlooking the Tuolumne Meadows on one side and stunning Lake Mono on the other.</p>`,
    hidden_content: null
  }, {
    heading: 'Clouds Rest',
    anchor: 'clouds-rest',
    carousel_id: 'carousel_3',
    body: `<p>One of the most challenging but rewarding hikes in the park is the 12.9 mile (20.8 km) round-trip trail to the incredible <strong>Clouds Rest</strong>. This trail has an elevation gain of about 3,900 feet (1,200 m).</p><p>The trail starts at Tenaya Lake and journeys very deep into the scenic rocky forest before arriving at Clouds Rest. From Clouds Rest you can enjoy truly breathtaking views over the Yosemite Valley and Half Dome from behind, and from a very high elevation.</p><p>Although this trail is very long and challenging, it is the highest recommended trail in the Tuolumne Meadows district and is also one of the most popular hikes in Yosemite National Park.</p>`,
    hidden_content: null
  }, {
    heading: 'Hetch Hetch Valley & Wapama Falls',
    anchor: 'hetch-hetchy-valley',
    carousel_id: null,
    body: `<p>One more amazing hike to consider is located northwest of Tuolumne Meadows and the Yosemite Valley, in yet another district of the national park. This area is known as the Hetch Hetchy Valley.</p><p>Within this valley you'll find the absolutely gorgeous <strong>Wapama Falls Trail</strong>, which leads to a massive powerful waterfall that flows into the picturesque <strong>Hetch Hetchy Reservoir Lake</strong>. This deep blue lake and the trail are surrounded by majestic rocky cliffs reminiscent of the Yosemite Valley. The round-trip distance for this awesome hike is approximately 4.6 miles (7.4 km) round-trip.</p>`,
    hidden_content: null
  }],
