  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The following attractions are listed in order along a recommended route down part of California's Pacific Coast Highway. This route covers the upper half of the Central California Coast, beginning just south of San Francisco and ending just north of Big Sur at Point Lobos.</p>`,
    hidden_content: null
  }, {
    heading: 'Pescadero & Pacifica, California',
    anchor: 'pescadero-and-pacifica',
    carousel_id: 'carousel_1',
    body: `<h3>Devil's Slide Bunker</h3><p>Just south of the San Francisco bay area in the town of Pacifica is the <strong>Devil's Slide Bunker</strong>, a fascinating abandoned concrete structure which sits atop a tall hill above the coast. You can reach this unique sight with a round-trip walk of about 0.8 miles (1.3 km) from the parking lot, and also enjoy enjoy marvelous coastal views from the bunker.</p><h3>Pescadero Beach</h3><p>A bit further south is <strong>Pescadero State Beach</strong>. At this beach you can take a short walk north from the parking lot to the clifftop peninsular viewpoint, from which you can enjoy excellent panoramic views over the rocky coastline.</p>`,
    hidden_content: null
  }, {
    heading: 'Beaches of Davenport, California',
    anchor: 'davenport-beaches',
    carousel_id: null,
    body: `<h3>Panther Beach</h3><p>Much further south along the coast closer to Santa Cruz are several more beautiful beaches, including <strong>Shark Fin Cove</strong>, which is named for the striking fin-like rock formation in the middle of the beach, which is quite picturesque.</p><h3>Shark Fin Cove</h3><p>Just south of Shark Fin Cove is <strong>Panther Beach</strong>, which features very strange and mesmerizing cliff formations that you can explore along the beach.</p>`,
    hidden_content: null
  }, {
    heading: 'Santa Cruz, California',
    anchor: 'santa-cruz',
    carousel_id: null,
    body: `<p>After enjoying the beaches you can continue along the coast to Santa Cruz, where you can visit the famous <strong>Santa Cruz Boardwalk</strong>, which features many carnival games and amusement park rides along the beach. Nearby the Boardwalk is the Santa Cruz Wharf, a giant pier from which you can hear and observe sea lions which reside below the end of the pier.</p><p>Santa Cruz also hosts the <strong>Natural Bridges State Beach</strong>, which is known for its stunning sea arch. Another popular attractions (although somewhat of a tourist trap) is Santa Cruz's Mystery Spot, a trippy place in the woods with many optical illusions, some seeming to defy gravity.</p>`,
    hidden_content: null
  }, {
    heading: 'Monterey Bay Aquarium',
    anchor: 'monterey-bay',
    carousel_id: 'carousel_2',
    body: `<p>Continue down the coast to the Cannery Row district of Monterey, which features many shops and restaurants, as well as the famous <strong>Monterey Bay Aquarium</strong>. This massive aquarium is considered to be the top aquarium on the western coast of the United States, and was even featured in the movie Finding Nemo 2.</p>`,
    hidden_content: null
  }, {
    heading: 'Carmel-by-the-Sea, California',
    anchor: 'carmel-by-the-sea',
    carousel_id: null,
    body: `<h3>17 Mile Drive</h3><p>Just west of Monterey Bay you can take the extremely scenic 17 Mile Drive coastal route where you can stop at the picturesque <strong>Lone Cypress Tree</strong> aas well as various viewpoints, the most popular being the Bird Rock Visa Point overlooking the rocky coastline.</p><h3>Carmel Mission Basilica</h3><p>The 17 Mile Drive road eventually reaches Carmel-By-The-Sea, where you can visit the 250 year old <strong>Carmel Mission Basilica Museum</strong>, an historic Spanish mission that's quite impressive.</p>`,
    hidden_content: null
  }, {
    heading: 'Point Lobos State Natural Reserve',
    anchor: 'point-lobos',
    carousel_id: null,
    body: `<p>Just south of Carmel-By-The-Sea is the gorgeous Point Lobos State Natural Reserve, which features magnificent scenery such as <strong>China Cove</strong>, the 0.8 mile (1.3 km) round-trip <strong>Cypress Grove Trail</strong>, and <strong>Whaler's Cove</strong>. Both of these coves feature stunning blue-green waters, while the Cypress Grove Trail traces around the wooded area of the westernmost point of Point Lobos.</p>`,
    hidden_content: null
  }],
