  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>The following attractions are listed in order along a recommended route up part of California's scenic northern coast along Highway 101. This route begins just north of Mendocino and Fort Bragg in the redwoods forests, and ends at the very top of the California Coast near Crescent City.</p>`,
    hidden_content: null
  }, {
    heading: 'Humboldt Redwoods State Park',
    anchor: 'humboldt-redwoods-state-park',
    carousel_id: 'carousel_1',
    body: `<p>Begin your day by taking the extremely scenic drive along the <strong>Avenue of the Giants</strong>, which runs parallel to Highway 101. This 32 mile (51 km) long road offers much better views of the towering redwood trees than the main highway.</p><p>Some great short hikes you might consider within the Humboldt Redwoods State Park are the 0.5 mile (0.8 km) round-trip <strong>Founders Grove Nature Trail</strong>, and the nearby 1.1 mile (1.8 km) round-trip <strong>Rockefeller Loop Trail</strong>. Both of these trails journey through the lush dense redwood forests.</p>`,
    hidden_content: null
  }, {
    heading: 'Eureka, California',
    anchor: 'eureka',
    carousel_id: null,
    body: `<p>Afterward enjoying the Avenue of the Giants you'll continue up Highway 101 for quite awhile before reaching the large seaside city of Eureka. In this city you might like to admire the <strong>Carson Mansion</strong>, a stunning Victorian home which is said to be the most photographed house in the USA.</p><p>You might also like to explore the lovely Old Town Eureka or visit the city's famous Lost Coast Brewery</p>`,
    hidden_content: null
  }, {
    heading: 'Trinidad, California',
    anchor: 'trinidad',
    carousel_id: null,
    body: `<p>North of Eureka be sure to stop at the quaint <strong>Trinidad Memorial Lighthouse</strong>, from which you can take in gorgeous views high above the picturesque Trinidad Harbor.</p><p>It's also possible to hike to the top of the peninsular hilly headland that you can see from the lighthouse, which is called Trinidad Head. This hike offers fantastic coastal views while hiking through lush green fields.</p>`,
    hidden_content: null
  }, {
    heading: 'Prairie Creek Redwoods State Park',
    anchor: 'prairie-creek-redwoods-state-park',
    carousel_id: 'carousel_2',
    body: `<p>Continue north to the Prairie Creek Redwoods State Park, which features two incredible trails. Both of these trails are the highest recommended attractions along the Upper Northern Coast.</p><h3>Lady Bird Johnson Grove Trail</h3><p>First you can hike the wondrous 1.3 mile (2.1 km) round-trip <strong>Lady Bird Johnson Grove Trail</strong> through an extremely scenic and wondrous redwood forest, which is among the best redwood hikes you'll find in Northern California.</p><p>If you're able to spread out this itinerary out over at least two days, it is highly recommended to hike the Lady Bird Johnson Grove Trail in the early morning when the fog gives the forest a beautiful mystical look.</p><h3>Fern Canyon Trail</h3><p>A bit further north you'll find the breathtaking <strong>Fern Canyon Trail</strong>, a 1.1 mile (1.8 km) round-trip hike which ventures through a stunning canyon surrounded by lush green walls on both sides. The trail journeys alongside a rocky stream inside of this vibrant canyon, with many wooden bridges and fallen branches along the serene rocky creek. Reaching the trailhead for the popular Fern Canyon is a bit challenging but definitely worth it.</p>`,
    hidden_content: null
  }, {
    heading: 'Crescent City, California',
    anchor: 'crescent-city',
    carousel_id: null,
    body: `<p>Continue up to Crescent City, where you can walk to the lovely <strong>Battery Point Lighthouse</strong>. This lighthouse sits on a tiny island, which is connected to the mainland by a path that disappears during high tide. This 1850s lighthouse and the island are quite picturesque, hosting excellent coastal views.</p>`,
    hidden_content: null
  }, {
    heading: 'Jedidiah Smith Redwoods State Park',
    anchor: 'jedidiah-smith-redwoods-state-park',
    carousel_id: null,
    body: `<p>Just south of the Oregon border outside of Crescent City is the Jedidiah Smith Redwood State Park, where you'll find two more amazing redwood trails.</p><p>The 0.7 mile (1.1 km) round-trip <strong>Stout Memorial Grove Trail</strong> is the more popular of the two, however the 0.8 mile (1.3 km) round-trip <strong>Simpson Reed Grove Trail</strong> is also quite scenic as well. Both of these trails journey through lush towering redwood forests, with the Stout Memorial Grove Trail being the more popular of the two.</p>`,
    hidden_content: null
  }],
