    meta_description: "Discover top attractions along California's Upper Northern Coast + Redwoods Parks & plan the perfect trip with our savable Attraction Lists for Google Maps",
    meta_keywords: 'upper northern california coast and redwoods southbound attractions guide, upper northern california coast and redwoods southbound top attractions, upper northern california coast and redwoods southbound destination guide, upper northern california coast and redwoods southbound google maps list, upper northern california coast and redwoods southbound california attractions',
    social_media_title: 'Upper Northern California Coast & Redwoods, California (Southbound) Attractions Guide',
    social_media_thumbnail: 'https://www.travelimager.com/images/california/California-Upper-Northern-Coast-Redwoods-National-Park-Highway-and-Redwood-Trees.jpg'
