  attractions_guide_content: [{
    heading: 'Introduction',
    anchor: null,
    carousel_id: null,
    body: `<p>Yosemite Valley is one of the most beautiful valleys on Earth with its towering canyon walls, vast forests, unique rock formations, and majestic waterfalls. Don't forget to explore the picturesque Tuolomne Meadows district of the national park as well, which is located north of Yosemite Valley.</p><p>Most of the Yosemite Valley is connected by free shuttles that conveniently link the major sights and trailheads with the parking areas and accommodations.</p>`,
    hidden_content: null
  }, {
    heading: 'Roadside Viewpoints',
    anchor: 'valley-viewpoints',
    carousel_id: 'carousel_1',
    body: `<p>One of the best viewpoints facing Yosemite Valley near the entrance is the <strong>Tunnel View</strong>, from which you can admire Bridalveil Falls, Half Dome, and more, all in one frame. A bit further into the valley you can enjoy amazing views from the <strong>Valley View</strong> vista point, which sits on the Merced River.</p>`,
    hidden_content: null
  }, {
    heading: 'Bridalveil Falls',
    anchor: 'bridalveil-falls',
    carousel_id: null,
    body: `<p>The first waterfall you'll reach upon entering the valley is <strong>Bridalveil Falls</strong>, which is so tall that most of the water turns to mist before reaching the ground. You can view the falls with a very short walk from the parking area.</p><h3>El Capitan</h3><p>Just east of Bridalveil Falls is the <strong>El Capitan Meadow</strong>, which is located beside the road. From the meadow you can marvel at the towering sheer cliffs on both sides of you, which soar 3,000 feet (900 m) above the meadow. One of these cliffs is <strong>El Capitan</strong>, an iconic cliff hosting extremely challenging rock climbing.</p>`,
    hidden_content: null
  }, {
    heading: 'Yosemite Falls',
    anchor: 'yosemite-falls',
    carousel_id: 'carousel_2',
    body: `<p>After El Capitan and west of the Yosemite Valley Visitor Center you can take the park's most popular short trail, which ventures to <strong>Lower Yosemite Falls</strong>. You can easily reach the falls with a round-trip walk of about 0.9 miles (1.4 km), with the option of climbing along the boulders to get up-close to the falls.</p><p>The lower section of the tiered Yosemite Falls is only about 320 feet (90 m) tall, however the drop of the <strong>Upper Yosemite Falls</strong> (which you can see from the valley) is much larger at about 1,430 feet (440 m) tall.</p><p>If you'd like to reach the top of the Upper Falls, you can hike the 5 mile (8 km) round-trip trail which hikes alongside the falls and offers amazing views of the falls and the valley, especially from <strong>Yosemite Point</strong> at the top. The trail has a huge elevation gain of nearly 3,200 feet (980 m) and also offers views of the cascading pools that lead to the waterfall.</p><h3>Cook's Meadow</h3><p>Near Yosemite Falls be sure to walk along the <strong>Cook's Meadow Loop</strong> boardwalk, which ventures through an open meadow, from which you can enjoy unobstructed views of Yosemite Falls and the surrounding canyon walls. Cook's Meadow Loop is also an incredible place to see the many stars of the night sky framed by the canyon.</p>`,
    hidden_content: null
  }, {
    heading: 'Yosemite Village',
    anchor: 'yosemite-village',
    carousel_id: null,
    body: `<p>Continuing further east you'll reach the town of Yosemite Valley which hosts many camping, lodging, and dining options, as well as the main Visitor Center.</p><p>A bit further into Yosemite Valley you can admire the <strong>Majestic Yosemite Hotel</strong> (formerly the Ahwanee), a massive upscale lodge-like hotel that you can explore without a reservation. Among the hotel's most famous features is its grand dining room.</p>`,
    hidden_content: null
  }, {
    heading: 'Mirror Lake Trail',
    anchor: 'mirror-lake',
    carousel_id: 'carousel_3',
    body: `<p>Beyond Yosemite Falls and the Majestic Yosemite Hotel are some of the park's most scenic and popular hikes.</p><p>The easy 5 mile (8 km) round-trip Mirror Lake Loop Trail ventures deep into the valley, with the iconic Half Dome formation towering above it. This trail follows along the Tenaya Creek, leading to the stunning <strong>Mirror Lake</strong>, which is named for the beautiful reflections of the canyon that you can admire on the surface of the lake.</p>`,
    hidden_content: `<p>Mirror Lake is located only about halfway through the trail into the canyon, but it's highly recommended to hike the entire 5 miles (8 km) of the trail, which passes along the lush picturesque meadows of the Tenaya Creek while venturing even deeper into the canyon.</p>`
  }, {
    heading: 'Mist Trail: Vernal Falls & Nevada Falls',
    anchor: 'mist-trail',
    carousel_id: null,
    body: `<p>From the Happy Isles Bridge you can hike the most highly recommended route in the park, which takes you along an extremely scenic journey past two powerful massive waterfalls, <strong>Vernal Falls</strong> and <strong>Nevada Falls</strong>.</p><p>First you'll follow the Mist Trail which is named for the intense mist produced by Vernal Falls, which will leave you refreshingly soaking wet. The trail continues up alongside Vernal Falls and then to Nevada Falls, before climbing to the top of this waterfall as well. From the top of Nevada Falls you can enjoy incredible views overlooking this section of the valley.</p>`,
    hidden_content: `<p>From the top of Nevada Falls you can continue along the John Muir Trail, which offers gorgeous views of Nevada Falls set amongst the Liberty Cap and Mount Broderick formations. The John Muir Trail eventually loops back to the Mist Trail.</p><p>This entire route is extremely scenic, with a round-trip hiking distance of roughly 6.4 miles (10.3 km) and an elevation gain of nearly 2,200 feet (670 m).</p>`
  }, {
    heading: 'Half Dome',
    anchor: 'half-dome',
    carousel_id: 'carousel_4',
    body: `<p>The legendary trail to Half Dome passes Vernal and Nevada Falls before reaching the iconic natural <strong>Half Dome</strong> formation and scaling the top of it. This challenging trail has a round-trip hiking distance of roughly 14.8 miles (23.8 km) and over 5,150 feet (1,570 m) of elevation gain.</p><p>Unfortunately the breathtaking Half Dome Trail can only be hiked with a permit, which must be applied for far in advance (usually months) and can be quite difficult to obtain.</p>`,
    hidden_content: null
  }, {
    heading: 'Glacier Point',
    anchor: 'glacier-point',
    carousel_id: null,
    body: `<p>After enjoying the valley, you can drive around up to <strong>Glacier Point</strong>, which sits nearly 3,200 feet (980 m) above the valley floor. From the top you can enjoy gorgeous views overlooking Half Dome and the surrounding valley, as well as Vernal and Nevada Falls (although from quite far away).</p><h3>Washburn Point & Sentinel Dome</h3><p>Just before Glacier Point be sure to stop at <strong>Washburn Point</strong>, which provides stunning views over the Vernal and Nevada Falls/Half Dome section of the Yosemite Valley. Nearby you can take the 2.1 mile (3.4 km) round-trip trail to <strong>Sentinel Dome</strong> for magnificent views overlooking the Yosemite Falls part of the valley.</p>`,
    hidden_content: null
  }],
